/**
 * Correlator vectors
 */
static inline int32_t adrv910x_NvsRegmapRxnb_Vcorrsig_Set(void *const device,
    uint32_t regInstance,
    const uint32_t value)
{
    int32_t status = 0;

    status = adi_bf_hal_Register_Write(device, (0x1200 + 0xe9 + 0x0 + (regInstance * 0x1)), (value >> 16));
    if (0 != status) return status;

    status = adi_bf_hal_Register_Write(device, (0x1200 + 0xd9 + 0x0 + (regInstance * 0x1)), (value >> 8));
    if (0 != status) return status;

    status = adi_bf_hal_Register_Write(device, (0x1200 + 0xc9 + 0x0 + (regInstance * 0x1)), (value >> 0));

    return status;
}

